import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Button, Typography, Box } from '@mui/material';

function LandingPage() {
  const navigate = useNavigate();
  return (
    <Box sx={{ textAlign: 'center', mt: 10 }}>
      <Typography variant="h2">Quiz App</Typography>
      <img src="/quiz-logo.png" alt="Quiz Logo" style={{ width: '200px', margin: '20px auto' }} />
      <div>
        <Button variant="contained" onClick={() => navigate('/admin-login')} sx={{ m: 2 }}>
          Admin Login
        </Button>
        <Button variant="contained" onClick={() => navigate('/user-login')} sx={{ m: 2 }}>
          User Login
        </Button>
      </div>
    </Box>
  );
}

export default LandingPage;
